             <Route path="/" element={<BOT/>}/>
             <Route path="/bot" element={<BOT/>}/>
            <Route path="/test-case" element={<TestCaseManagement/>}/>
            <Route path="/device-management" element={<Device/>}/>
            <Route path="/account-management" element={<Account/>}/>
          </Routes>
        </Router>

    </div>
  )
}
export default App
